webpackJsonp([67785393303036],{6607:function(e,t){e.exports={data:{post:{html:'<p>We finally have a humble start on the web site for <a title="Lüllauer Gegen-Wind" href="http://www.luellauergegenwind.de/">Lüllauer Gegen-Wind</a>, our village initiative against wind generators. Our neighbor Michael has gathered a ton of material on the subject, and my wfie and I are trying to filter and organize that information. I used Movable Type to set it up, but it\'s not a weblog yet, no comments or trackbacks, and we still have the default MT design. But I thought I\'d mention it here for the benefit of Google, as well as for any other readers who are interested.</p>',fields:{title:"",date:"17 Jan 2004",url:"https://papascott.de/2004-01-17-luellauer-gegen-wind/"}}},pathContext:{slug:"/2004-01-17-luellauer-gegen-wind/",prev:{fields:{title:"BSD For Linux Users",date:"17 Jan 2004",slug:"/2004-01-17-bsd-for-linux-users/"}},next:{fields:{title:"Anil Dash: Microsoft *nix",date:"19 Jan 2004",slug:"/2004-01-19-anil-dash-microsoft-nix/"}}}}}});
